    static member inline valuesuffix (value: string) = Interop.mkSankeyAttr "valuesuffix" value
    /// Sets the font for node labels
    static member inline textfont (properties: #ITextfontProperty list) = Interop.mkSankeyAttr "textfont" (createObj !!properties)
    /// The nodes of the Sankey plot.
    static member inline node (properties: #INodeProperty list) = Interop.mkSankeyAttr "node" (createObj !!properties)
    /// The links of the Sankey plot.
    static member inline link (properties: #ILinkProperty list) = Interop.mkSankeyAttr "link" (createObj !!properties)
    /// Sets the source reference on plot.ly for  ids .
    static member inline idssrc (value: string) = Interop.mkSankeyAttr "idssrc" value
    /// Sets the source reference on plot.ly for  customdata .
    static member inline customdatasrc (value: string) = Interop.mkSankeyAttr "customdatasrc" value
    /// Sets the source reference on plot.ly for  meta .
    static member inline metasrc (value: string) = Interop.mkSankeyAttr "metasrc" value

[<AutoOpen>]
module sankey =
    /// Determines whether or not this trace is visible. If *legendonly*, the trace is not drawn, but can appear as a legend item (provided that the legend itself is visible).
    [<Erase>]
    type visible =
        static member inline legendonly = Interop.mkSankeyAttr "visible" "legendonly"
        static member inline false' = Interop.mkSankeyAttr "visible" "false"
        static member inline true' = Interop.mkSankeyAttr "visible" "true"

    /// Determines which trace information appear on hover. If `none` or `skip` are set, no information is displayed upon hovering. But, if `none` is set, click and hover events are still fired. Note that this attribute is superseded by `node.hoverinfo` and `node.hoverinfo` for nodes and links respectively.
    [<Erase>]
    type hoverinfo =
        static member inline all = Interop.mkSankeyAttr "hoverinfo" "all"
        static member inline none = Interop.mkSankeyAttr "hoverinfo" "none"
        static member inline skip = Interop.mkSankeyAttr "hoverinfo" "skip"

    /// Sets the orientation of the Sankey diagram.
    [<Erase>]
    type orientation =
        static member inline h = Interop.mkSankeyAttr "orientation" "h"
        static member inline v = Interop.mkSankeyAttr "orientation" "v"

    /// If value is `snap` (the default), the node arrangement is assisted by automatic snapping of elements to preserve space between nodes specified via `nodepad`. If value is `perpendicular`, the nodes can only move along a line perpendicular to the flow. If value is `freeform`, the nodes can freely move on the plane. If value is `fixed`, the nodes are stationary.
    [<Erase>]
    type arrangement =
        static member inline fixed' = Interop.mkSankeyAttr "arrangement" "fixed"
        static member inline freeform = Interop.mkSankeyAttr "arrangement" "freeform"
        static member inline perpendicular = Interop.mkSankeyAttr "arrangement" "perpendicular"
        static member inline snap = Interop.mkSankeyAttr "arrangement" "snap"

